import React from "react";
import {Navbar, Nav} from 'react-bootstrap';
import Link from "react-router-dom/modules/Link";

function NavigationBar() {

    return (
        <Navbar bg={"dark"}>
            <Nav>
                <Link>My Recipes</Link>
                <Link>New Recipes</Link>
            </Nav>
        </Navbar>
    )
}

export default NavigationBar;
